import React from "react";
import "./output.css";

function Button(props) {
  return (
    <button
      className={`h-[6vh]  ${
        props.width || "w-[18vw]"
      }rounded-xl flex justify-center items-center bg-[#914BF1] mt-10 cursor-pointer`}
      onClick={props.onClick} // Calls the function passed via props
    >
      {props.text}
    </button>
  );
}

export default Button;
